{
  "AWSTemplateFormatVersion": "2010-09-09",
  "Description": "The template used to create an ECS Service from the ECS Console.",
  "Parameters": {
    "ECSClusterName": {
      "Type": "String",
      "Default": "insights"
    },
    "SecurityGroupIDs": {
      "Type": "String",
      "Default": "sg-0e563fefd26ffdd33"
    },
    "SubnetIDs": {
      "Type": "CommaDelimitedList",
      "Default": "subnet-023db907202d61c00"
    },
    "VpcID": {
      "Type": "String",
      "Default": "vpc-072f438c953672ace"
    },
    "LoadBalancerType": {
      "Type": "String",
      "Default": "application",
      "AllowedValues": [
        "application",
        "network"
      ],
      "ConstraintDescription": "must specify an application or network load balancer type."
    },
    "LoadBalancerName": {
      "Type": "String",
      "Default": ""
    }
  },
  "Resources": {
    "ECSService": {
      "Type": "AWS::ECS::Service",
      "Properties": {
        "Cluster": "insights",
        "CapacityProviderStrategy": [
          {
            "CapacityProvider": "FARGATE",
            "Base": 0,
            "Weight": 1
          }
        ],
        "TaskDefinition": "arn:aws:ecs:us-east-1:644160558196:task-definition/nodejs-fargate-task:2",
        "ServiceName": "insights",
        "DesiredCount": 1,
        "NetworkConfiguration": {
          "AwsvpcConfiguration": {
            "AssignPublicIp": "ENABLED",
            "SecurityGroups": [
              {
                "Ref": "SecurityGroupIDs"
              }
            ],
            "Subnets": {
              "Ref": "SubnetIDs"
            }
          }
        },
        "PlatformVersion": "LATEST",
        "DeploymentConfiguration": {
          "MaximumPercent": 200,
          "MinimumHealthyPercent": 100
        },
        "DeploymentController": {
          "Type": "ECS"
        }
      }
    }
  },
  "Outputs": {
    "ClusterName": {
      "Description": "The cluster used to create the service.",
      "Value": {
        "Ref": "ECSClusterName"
      }
    },
    "ECSService": {
      "Description": "The created service.",
      "Value": {
        "Ref": "ECSService"
      }
    }
  }
}
